import React from "react";
import "./Card.scss";

const Card = () => {
  <section className="todo">
    <h1 style={{ color: props.color }}>{props.title}</h1>
    <section className="card" style={{ backgroundImage: `url(${props.img})` }}>
      <div className="contenedor-Texto">
        <p className="powerful">{props.subtitle}</p>
        <p>{props.texto}</p>
      </div>
    </section>
  </section>;
};

export default Card;
